@import url("https://fonts.googleapis.com/css?family=Ubuntu:400,700&display=swap");
@import url("https://fonts.googleapis.com/css?family=Catamaran:400,700&display=swap");
.nav .menu-list li:hover, .hero .hero-text button:hover, .hero .dots .dot:hover, .hero .phone-icon:hover, .about .about-columns .about-left-bar button:hover, .about .about-columns .about-right-bar:hover img, .about .about-columns .about-right-bar:hover .watch-video h2, .about .about-columns .about-right-bar:hover .watch-video .fa-play-circle:before, .projects .gallery-tabs .tab:hover, .projects .projects-gallery .row .gallery-img:hover img, .projects button:hover, .team .workers-list .worker .social-media i:hover, .team .dots .dot:hover, .clients .dots .dot:hover, .price .price-container .price-box button:hover, .premium .dots .dot:hover, .premium button:hover, .contact .contact-form form button:hover, footer .footer-container .arrow-up:hover .circle-arrow, footer .footer-container .arrow-up:hover .fa-chevron-up, footer .footer-container .socialmedia-footer .social-media .fa-stack:hover .fa-circle, footer .footer-container .subscribe form button:hover {
  transition: 0.3s ease-in; }

body {
  margin: 0;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center; }

.container {
  font-family: 'Ubuntu', sans-serif;
  max-width: 1600px;
  width: 100%; }

.section-header {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin: 45px 0; }
  .section-header header {
    font-size: 30px;
    font-weight: 700;
    color: black;
    text-transform: uppercase;
    text-align: center; }
  .section-header h5 {
    font-size: 15px;
    font-weight: 700;
    color: #AEAEAE;
    text-transform: uppercase;
    margin: 10px 0;
    text-align: center; }

/* media queries */
@media (max-width: 575.98px) {
